.fabu {
  width: 100vw;
  height: 100vh;
  background: #122f7e;
}
/* 头部标签 */
.header {
  height: 8%;
  width: 100%;
  margin-bottom: 10px;
  background-image: url("../../../assets/yingzhi/topback.png");
  background-repeat: no-repeat;
  background-size: 100%;
}
.daoy {
  position: relative;
  left: 20px;
  top: 5px;
}
.header_text {
  width: 30%;
  text-align: center;
  color: #fff;
  line-height: 50px;
  font-size: 20px;
  letter-spacing: 10px;
  float: left;
  position: absolute;
  left: 50%;
  top: 0%;
  margin-left: -15%;
}
.body {
  width: 95vw;
  height: 85vh;
  background: rgba(240, 240, 240, 0.15);
  margin-left: 2.5vw;
  padding-top: 20px;
}
/* 名称等部分 */
.bodyheder {
  margin-left: 20px;
}
.bodyheder div {
  color: #fff;
  display: inline-block;
  margin-left: 10px;
  font-size: 13px;
}
.bodyheder div input,
select {
  border-radius: 5px;
  outline-style: none;
  width: 150px;
  height: 30px;
  text-align: center;
  margin-right: 10px;
  outline-width: 0px;
  border: none;
  border-style: none;
  text-shadow: none;
}
/* 文件类型切换 */
.qie {
  margin-left: 20px;
}
.qie div {
  display: inline-block;
  width: 50px;
  text-align: center;
  height: 60px;
  margin-left: 10px;
  line-height: 60px;
  cursor: pointer;
}
/* 图层 */
.tuc {
  width: 95%;
  height: 80%;
  /* position: absolute; */
  margin-left: 2.5%;
  background: #fff;
  margin-top: 20px;
}
/* 屏幕选择 */
.bodyheder .rightan {
  float: right;
  width: 50px;
  margin-right: 20px;
  text-align: center;
  background: #fff;
  color: #000;
  border-radius: 5px;
}
.tuc2_left {
  float: left;
  width: 20%;
  border-right: 1px solid #000;
  height: 100%;
}
.left_header {
  padding-left: 10px;
}
.left_body {
  margin-left: 30px;
  font-size: 13px;
  margin-top: 10px;
  cursor: pointer;
}
.tuc2_right {
  float: right;
  width: 79%;
  height: 100%;
}
.tuc2_right table {
  width: 98%;
  border: 1px solid #000;
  margin-top: 10px;
}
.tuc2_right table td,
th {
  width: 16%;
  border: 1px solid #000;
  text-align: center;
  height: 30px;
}
.tuc2_right table td {
  font-size: 15px;
}
.bodyheder .shiinp {
  height: 25px;
  appearance: none;
}
select::-ms-expand {
  display: none;
}
